INSERT INTO `reports` VALUES (1,0,'Report 1','bar chart','global','custom','days','SELECT DISTINCT user_pin,SUM(s.q1) AS totalSurveyScore,DAYNAME(s.date_time) AS reportDate,GROUP_CONCAT(CONCAT(s.q1,\'---+++--\', DAYNAME(s.date_time)) SEPARATOR \'___---___\') AS totalWithRange,CONCAT(\'Record Shown from \',DATE_FORMAT(\'2014-03-01 00:00\',\'%d-%m-%Y %H:%i\') ,\' to \' , DATE_FORMAT(\'2014-04-30 00:00\',\'%d-%m-%Y %H:%i\')) AS recordShownMessage,GROUP_CONCAT(DISTINCT(full_name)) AS AgentFullName,full_name,s.q1 , cc.logo AS logo  FROM surveys s LEFT JOIN users u ON u.user_id = s.user_id\n				 LEFT JOIN user_companies uc ON uc.user_id = u.user_id\n				 LEFT JOIN campaigns c ON c.camp_id = s.camp_id\n				 LEFT JOIN companies cc ON cc.comp_id=uc.comp_id\n				  WHERE user_pin != \'\' AND acc_id = 4 AND Date_format(s.date_time,\'%Y-%m-%e %H:%i\') >= \'2014-03-01 00:00\' AND Date_format(s.date_time,\'%Y-%m-%e %H:%i\') <= \'2014-04-30 00:00\'GROUP BY reportDate ORDER BY s.date_time','','2014-03-01 00:00:00','2014-04-30 00:00:00','a:1:{i:0;s:3:\"AND\";}','a:1:{i:1;s:8:\"user_pin\";}','a:1:{i:1;s:2:\"ne\";}','a:1:{i:1;s:0:\"\";}','data','','',0,'',0,0,1,'#f6eaea','Custom ( Days )','s.q1','','Normal',1,'Agent PIN',2,2,'2014-04-10 05:26:00',2,'2014-05-08 14:23:06'),(2,0,'Report 2','line graph','global','last month','hours','SELECT DISTINCT user_pin,full_name,SUM(s.q1) AS totalSurveyScore,CONCAT(DATE_FORMAT(DATE_SUB(s.date_time, INTERVAL 1 HOUR), \'%h:%i%p\'),\' to \',DATE_FORMAT(DATE_SUB(s.date_time, INTERVAL 0 HOUR), \'%h:%i\'), DATE_FORMAT(s.date_time, \'%p\'))   AS reportDate ,GROUP_CONCAT(CONCAT(s.q1,\'---+++--\',CONCAT(DATE_FORMAT(DATE_SUB(s.date_time, INTERVAL 1 HOUR), \'%h:%i%p\'),\' to \',DATE_FORMAT(DATE_SUB(s.date_time, INTERVAL 0 HOUR), \'%h:%i%p\'))) SEPARATOR \'___---___\') AS totalWithRange,CONCAT(\'Record Shown for \',MONTHNAME(DATE_SUB(NOW(), INTERVAL 1 MONTH)),\',\',YEAR(s.date_time)) AS recordShownMessage,GROUP_CONCAT(DISTINCT(full_name)) AS AgentFullName,full_n